import { Facebook, Instagram, Pinterest, Twitter } from "@mui/icons-material";
import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  height: 50vh;
  background-color: black;
`;
const Left = styled.div`
  flex: 1;
`;
const Center = styled.div`
  flex: 1;
`;
const Right = styled.div`
  flex: 1;
`;

const Fotter = () => {
  return <Container>
    <Left>
      <Logo>Isuru.</Logo>
      <Desc></Desc>
      <SocialContainer>
         <SocialIcon>
            <Facebook/>
         </SocialIcon>
         <SocialIcon>
            <Instagram/>
         </SocialIcon>
         <SocialIcon>
            <Twitter/>
         </SocialIcon>
         <SocialIcon>
            <Pinterest/>
         </SocialIcon>
         
      </SocialContainer>
    </Left>
    <Center></Center>
    <Right></Right>
  </Container>;
};

export default Fotter;
